import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import { Menu, Image, Container } from 'semantic-ui-react';
import GoogleAuthContextProvider from '../../apis/googleAuthContext';
import GoogleAuth from '../../apis/googleAuth';
import { useState } from 'react'

const Navbar = () => {
    const [activeItem, setActiveItem] = useState('Fixtures/Results')
    // state = { activeItem: 'Fixtures/Results' }

    // const handleItemClick = (e, { name }) => this.setState({ activeItem: name })
    const handleItemClick = (e) => {
        // setActiveItem(e.target.name)
        console.log(e)
    }

    return (
        <Menu inverted stackable size='huge' style={{ backgroundColor: '#37003C', margin: '0rem', borderRadius: '0rem'}}>
            <Container>
                <Menu.Item header style={{ color: 'white' }}><Image size='tiny' src='/images/PL-Lion.png'/>PremInfo</Menu.Item>
                <Menu.Item
                    as='div'
                    style={{ color: 'white' }}
                    name='Live Scores'
                    active={activeItem === 'Live Scores'}
                    onClick={handleItemClick}
                >
                <NavLink to='/livescores'>Live Scores</NavLink>
                </Menu.Item>
                <Menu.Item
                    as='div'
                    style={{ color: 'white' }}
                    name='News'
                    active={activeItem === 'News'}
                    onClick={handleItemClick}
                >
                <Link to='/news'>News</Link>
                </Menu.Item>
                <Menu.Item
                    as='div'
                    style={{ color: 'white' }}
                    name='Fixtures/Results'
                    active={activeItem === 'Fixtures/Results'}
                    onClick={handleItemClick}
                >
                <Link to='/'>Fixtures/Results</Link>
                </Menu.Item>
                <Menu.Item
                    as='div'
                    style={{ color: 'white' }}
                    name='Table'
                    active={activeItem === 'Table'}
                    onClick={handleItemClick}
                >
                <Link to='/leaguetable'>Table</Link>
                </Menu.Item>
                <Menu.Item
                    position="right"
                    style={{ color: 'white' }}
                    name='Sign in'
                    active={activeItem === 'Sign In'}
                    onClick={handleItemClick}
                >
                <GoogleAuthContextProvider>
                  <GoogleAuth/>
                </GoogleAuthContextProvider>
                </Menu.Item>
            </Container>
        </Menu>
    )
}


export default Navbar;
